(7, 'P9540840', 45, 'Fair & White Exclusive Whitenizer Lightening Cream', 'Fair & White Exclusive Whitenizer Lightening Cream 1.7 oz / 50 g\n\nExclusive Lightening Cream has been specifically formulated to lighten facial discoloration, restoring a brighter, even skin tone. This high performance light textured cream hydrates dry damaged skin as it enhances skins comfort, softening and smoothing skin, promoting a luminous glow.\n\nMain Ingredient:Â 1.9% Hydroquinone (Hydroxyphenol).', NULL, 'Â£ 16.99', NULL, 1, '2020-10-31 20:53:51', '2020-10-31 20:53:51'),
(8, 'P2327640', 45, 'Fair & White Gold Ultimate Prepare Argan Oil Exfol', 'Fair & White Gold Ultimate Prepare Argan Oil Exfoliating Soap 7 oz / 200 g\n\nExperience the gentle exfoliation of this precious soap. Infused with Argan oil to nourish and soothe skin while eliminating dead skin cells and impurities with Apricot Kernel. Reveal soft and radiant skin.\n\nCell renewal slows down as we age giving the skin a dull appearance, therefore exfoliation is an important step to allow active ingredients to penetrate the skin much more effectively, instantly improving skinâ€™s texture and enhancing skinâ€™s radiance.\n\nMain Ingredients:Â Apricot exfoliating grains, hydrating Glycerin, Argan Oil.', NULL, 'Â£ 5.49', NULL, 1, '2020-10-31 20:56:48', '2020-10-31 20:56:48'),
(9, 'P3369946', 45, 'Fair and White Exclusive Whitenizer Exfoliating So', 'Fair and White Exclusive Whitenizer Exfoliating Soap 200g\n\nCleanses and buffs away dead skin cells, instantly restoring radiance with Apricot seed Powder, promoting a healthy glow. Smoothes skins texture with hydrating and nourishing Glycerin. Tip: Cellular turnover slows down as we age giving the skin a dull appearance therefore, exfoliation is an important step to add to your daily skincare regimen, immediately improving skin\'s', NULL, 'Â£ 4.99', NULL, 1, '2020-10-31 21:08:02', '2020-10-31 21:08:20'),
(10, 'P3714953', 45, 'Soft & Precious Nursery Jelly Skin Protectant Crea', 'This Creamy helps treat and prevent diaper rash and protects chafed skin due to diaper rash. Also helps seal out wetness', NULL, 'Â£ 2.99', NULL, 1, '2020-10-31 21:19:28', '2020-10-31 21:19:28'),
(11, 'P1428834', 45, 'ORS Olive Oil Nourishing Sheen Spray', 'Organic ROOT Stimulator Nourishing Sheen Spray has taken hydrating botanicals and blended them with olive oil into a vitamin rich crÃ¨me that replenishes the \"natural\" moisture balance of the hair. Proclaimed as \"liquid gold\", olive oil has been used for over 5000 years as a healing elixir, restoring new life to anything it touches.', NULL, 'Â£ 3.99', NULL, 1, '2020-10-31 21:22:16', '2020-10-31 21:22:16'),
(12, 'P5784054', 45, 'XPRESSION LAGOS BRAID Pre-Pulled Hair Extension(36', 'Description\n\nXPRESSION LAGOS BRAID Pre Pulled Stretched Hair Hot Water Use Pre-Cut Pre-Picked Two different Length per Pack (36â€³, 44â€³) Super light Tangle Free Brushable', NULL, 'Â£ 3.00', NULL, 1, '2020-10-31 21:26:45', '2020-10-31 21:26:45'),
(13, 'P2689085', 46, 'How to turn my passion to profit', 'Have you ever wondered how people just post on their blogs or on a YouTube channel about things they like and get paid for it! \n\nWell I have an online coaching program showing how you can easily turn your passion or hobby into profit with some simple guided steps to help you turn what you love into a paid income.\n\nPlease visit my website to learn more\nwww.freetownmindset.com', NULL, 'Â£ 57', NULL, 1, '2020-11-02 03:29:48', '2020-11-02 03:29:48'),
(14, 'P5931940', 45, 'SofNfree Black Castor Oil Anti-Dandruff Moisturisi', 'Black Castor Oil Braid Moisturising Spray is a perfect blend of natural oils to help hydrate and condition braids, locs, twists and natural hair. This non-greasy formula soothes and prevents dry, itchy scalp and seals moisture into the hair and scalp to help prevent hair breakage. Great for braids and twists and works extremely well on synthetic hair.', NULL, 'Â£ 2.99', NULL, 1, '2020-11-03 16:57:23', '2020-11-03 16:57:23'),
(15, 'P5267096', 45, 'Sulfur 8 Anti-Dandruff Braid Spray 356ml', 'Medicated Anti-Dandruff Conditioned and Dandruff Treatment for Braids\n\nPREVENTS DRY ITCHING SCALP\n\nUse Sulfur 8 for softer more comfortable braids\nSoftens hair & moisturizes scalp\nBeautiful braids without the itch\nRegular use keeps your braids shiny and natural looking', NULL, 'Â£ 5.49', NULL, 1, '2020-11-03 17:01:05', '2020-11-03 17:01:05'),
(16, 'P2822131', 45, 'Makari Bebe Cleansing Milk Bath Wash 33.8 oz / 100', 'Makari Baby Cleansing Milk Bath Wash softens, moisturizes and cleanses your baby\'s skin.\nWet/Dry nourishing cleansing lotion.\nTall pump bottle for easy dispensing.\nRecommended for delicate and sensitive skin types.', NULL, 'Â£ 16.99', NULL, 1, '2020-11-03 17:04:25', '2020-11-03 17:04:25'),
